import React, { Component } from "react";

import { BrowserRouter as Route, Link } from "react-router-dom";

import Control_Risk from "./control_risk_list.component";

class Home extends Component {

	render() {

		console.log(this);

		return(

			<div className = 'container'>

				<div>

					<button type="button" className="btn btn-primary btn-lg">

						Administrador de matriz de riesgo

					</button>

				</div>

				<div>

					<Link to = { str.concat(this.props.match.url, 'control_risk_consult')} className="nav-link">

	                    Trabajador

                  	</Link>

				</div>

				<Route path = '${this.props.match.path}/control_risk_consult' exact component = {Control_Risk} />

			</div>

		);

	}

}

export default Home;
